function App() {
  var gapi = window.gapi;
  var API_KEY = "AIzaSyDjOmUfOFphy62WfxzbK4sZWabX5mC6a2A";
  var CLIENT_ID =
    "289358638150-bhonr4g2buq9tftbbss39cqbofc9duag.apps.googleusercontent.com";
  var CLIENT_SECRET = "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";
  var DISCOVERY_DOCS =
    "https://www.googleapis.com/discovery/v1/apis/calendar/v3/rest";
  var SCOPES = "https://www.googleapis.com/auth/calendar.readonly";

  const handleClick = () => {
    gapi.load("client:auth2", () => {
      console.log("load client");

      gapi.client.init({
        apiKey: API_KEY,
        clientId: CLIENT_ID,
        discoveryDocs: DISCOVERY_DOCS,
        scope: SCOPES,
      });

      gapi.client.load("calendar", "v3", () => console.log("bom"));

      gapi.auth2
        .getAuthInstance()
        .signIn()

    });
  };

  return (
    <>
      <div className="container">
        <button onClick={handleClick}>Add Event</button>
      </div>
    </>
  );
}

export default App;
